import React, { Component } from "react";

class Error extends Component {
  render() {
    const { status, message } = this.props;
    return (
      <div>
        <h1>Error</h1>
        <p>
          Status:{status} {message}
        </p>
      </div>
    );
  }
}

export default Error;

